# Get Call Status


async def get_call_status(chat_id):
    calls = await call.calls
    chat_call = calls.get(chat_id)
    if chat_call:
        status = chat_call.capture
        if status == Call.Status.IDLE:
            call_status = "IDLE"
        elif status == Call.Status.ACTIVE:
            call_status = "PLAYING"

        elif status == Call.Status.PAUSED:
            call_status = "PAUSED"
    else:
        call_status = "NOTHING"

    return call_status


