@bot.on_message(cdx("update") & bot_owner_only)
async def update_repo_latest(client, message):
    response = await message.reply_text("·¥Ñ ú·¥á·¥Ñ·¥ã…™…¥…¢ Íú∞·¥è Ä ·¥Ä·¥†·¥Ä…™ ü·¥Ä ô ü·¥á ·¥ú·¥ò·¥Ö·¥Ä·¥õ·¥áÍú±...")
    try:
        repo = Repo()
    except GitCommandError:
        return await response.edit("…¢…™·¥õ ·¥Ñ·¥è·¥ç·¥ç·¥Ä…¥·¥Ö ·¥á Ä Ä·¥è Ä")
    except InvalidGitRepositoryError:
        return await response.edit("…™…¥·¥†·¥Ä ü…™·¥Ö …¢…™·¥õ  Ä·¥á·¥òÍú±…™·¥õ·¥è Ä è")
    to_exc = f"git fetch origin Bad &> /dev/null"
    os.system(to_exc)
    await asyncio.sleep(7)
    verification = ""
    REPO_ = repo.remotes.origin.url.split(".git")[0]  # main git repository
    for checks in repo.iter_commits(f"HEAD..origin/Bad"):
        verification = str(checks.count())
    if verification == "":
        return await response.edit("Bot is up-to-date!")
    updates = ""
    ordinal = lambda format: "%d%s" % (
        format,
        "tsnrhtdd"[(format // 10 % 10 != 1) * (format % 10 < 4) * format % 10 :: 4],
    )
    for info in repo.iter_commits(f"HEAD..origin/Bad"):
        updates += f"<b>‚û£ #{info.count()}: [{info.summary}]({REPO_}/commit/{info}) by -> {info.author}</b>\n\t\t\t\t<b>‚û• Commited on:</b> {ordinal(int(datetime.fromtimestamp(info.committed_date).strftime('%d')))} {datetime.fromtimestamp(info.committed_date).strftime('%b')}, {datetime.fromtimestamp(info.committed_date).strftime('%Y')}\n\n"
    _update_response_ = "<b>·¥Ä …¥·¥á·¥° ·¥ú·¥ò·¥Ö·¥Ä·¥õ·¥á …™Íú± ·¥Ä·¥†·¥Ä…™ ü·¥Ä ô ü·¥á Íú∞·¥è Ä ·¥õ ú·¥á  ô·¥è·¥õ!</b>\n\n‚û£ ·¥ò·¥úÍú± ú…™…¥…¢ ·¥ú·¥ò·¥Ö·¥Ä·¥õ·¥áÍú± …¥·¥è·¥°</code>\n\n<u>·¥ú·¥ò·¥Ö·¥Ä·¥õ·¥áÍú±</u>\n\n"
    _final_updates_ = _update_response_ + updates
    if len(_final_updates_) > 4096:
        link = await paste_queue(updates)
        url = link + "/index.txt"
        nrs = await response.edit(
            f"<b>·¥Ä …¥·¥á·¥° ·¥ú·¥ò·¥Ö·¥Ä·¥õ·¥á …™Íú± ·¥Ä·¥†·¥Ä…™ ü·¥Ä ô ü·¥á Íú∞·¥è Ä ·¥õ ú·¥á  ô·¥è·¥õ!</b>\n\n‚û£ ·¥ò·¥úÍú± ú…™…¥…¢ ·¥ú·¥ò·¥Ö·¥Ä·¥õ·¥áÍú± …¥·¥è·¥°</code>\n\n<u>·¥ú·¥ò·¥Ö·¥Ä·¥õ·¥áÍú±</u>\n\n[·¥Ñ ü…™·¥Ñ·¥ã  ú·¥á Ä·¥á ·¥õ·¥è ·¥Ñ ú·¥á·¥Ñ·¥ã·¥è·¥ú·¥õ ·¥ú·¥ò·¥Ö·¥Ä·¥õ·¥áÍú±]({url})"
        )
    else:
        nrs = await response.edit(_final_updates_, disable_web_page_preview=True)
    os.system("git stash &> /dev/null && git pull")
    await response.edit(
        f"{nrs.text}\n\n ô·¥è·¥õ ·¥°·¥ÄÍú± ·¥ú·¥ò·¥Ö·¥Ä·¥õ·¥á·¥Ö Íú±·¥ú·¥Ñ·¥Ñ·¥áÍú±Íú±Íú∞·¥ú ü ü è! …¥·¥è·¥°, ·¥°·¥Ä…™·¥õ Íú∞·¥è Ä 1 - 2 ·¥ç…™…¥Íú± ·¥ú…¥·¥õ…™ ü ·¥õ ú·¥á  ô·¥è·¥õ  Ä·¥á ô·¥è·¥è·¥õÍú±!"
    )
    os.system("pip3 install -r requirements.txt --force-reinstall")
    os.system(f"kill -9 {os.getpid()} && python3 -m YukkiMusic")
    sys.exit()
    return


